import React, { useState, useEffect } from "react";

const userUrl = "/api/users";

function Customers() {
  const [userData, setUserData] = useState([]);

  useEffect(() => {
    getGitHubUserWithFetch();
  }, []);

  const getGitHubUserWithFetch = async () => {
    const response = await fetch(userUrl);
    const jsonData = await response.json();
    setUserData(jsonData);
  };

  return (
    <div className="App">
      <header className="App-header">
        <h2>Users</h2>
      </header>
      <div className="user-container">
          {userData.map((user,index)=>
          <ul className="infoclass">
            <li className="info" key={user.index}>firstname:{user.firstName}</li>
            <li className="info" key={user.index}>lastname:{user.lastName}</li>
            <li className="info" key={user.index}>email:{user.email}</li>
            <li className="info" key={user.index}>username:{user.userName}</li>
          </ul>
   
             )} 
      </div>
    </div>
  );
}

export default Customers;
